const Home = () => {
    const[name,setName] = useState('loki');    
    const[age,setAge] =useState(10000)  


    const handleClick = () => {
        setName("ram");
        setAge(10000000000);
    }
    return ( 
        <div className="Home">
            <h2>Homepage</h2>
            <p>{name} is {age} years old</p>
            <button onClick={handleClick}>Click Me</button>
        </div>
     );
    }


export default Home;
